def mzmine_filtered_querier(cloned_job,
                            dataset_name,
                            user,
                            passkey,
                            user_email,
                            identifier = ""
                            ):
    """
    Automatically queries various pre-defined MassQL head group queries

    :param str cloned_job: URL to Proteomics2 job with presets to be cloned
    :param str dataset_name: Name of dataset, used for labeling jobs
    :param str user: Your Proteomics2 username
    :param str passkey: Your Proteomics2 password
    :param str user_email: Your email
    :param str identifier: Optional identifier appended to identify each job
    :return: Dataframe with the links to queries of different head groups
    :rtype: pandas.DataFrame
    """

    result_columns = ["Head", "query_job"]
    batch_unprocessed_query_results = pd.DataFrame(columns=result_columns)

    #Clear old login information
    driver.get("https://gnps2.org/logout")

    #Login to GNPS2
    driver.get("https://gnps2.org/login")

    #Enter username
    username = WebDriverWait(driver, 5).until(EC.presence_of_element_located((By.NAME,
                                                                              'username'
                                                                              )))
    username.clear()
    username.send_keys(user)

    #Enter password
    password = WebDriverWait(driver, 5).until(EC.presence_of_element_located((By.NAME,
                                                                              'password'
                                                                              )))
    password.clear()
    password.send_keys(passkey)
    password.send_keys(Keys.ENTER)

    #Visit original link
    task_id = cloned_job[cloned_job.find("task=") + 5:]
    cloning_link = "https://gnps2.org/workflowinput?workflowname=massql_workflow&task=" + task_id
    driver.get(cloning_link)
    #Begin queries
    i = 0
    for key in queries_data.keys():
        #Revisit cloned job
        driver.get(cloning_link)

        #Wait until entry fields have loaded in
        WebDriverWait(driver, 20).until(EC.presence_of_element_located((By.NAME,
                                                                        'description'
                                                                        )))
        #Enter in job name
        job_name = dataset_name + " " + key + " " + identifier
        name_field = driver.find_element(By.NAME, 'description')
        name_field.clear()
        name_field.send_keys(job_name)

        #Enter in query information
        job_query = queries_data[key]
        WebDriverWait(driver, 20).until(EC.presence_of_element_located((By.NAME,
                                                                        'query'
                                                                        )))
        query_field = driver.find_element(By.NAME, 'query')
        query_field.clear()
        query_field.send_keys(job_query)

        #Submit job
        submit = driver.find_element(By.XPATH, "/html/body/div/div/form/button")
        submit.click()

        #Wait until job has been processed
        WebDriverWait(driver, 15).until(EC.element_to_be_clickable((By.XPATH,
                                                                    "/html/body/div/div[1]/div[2]/div[1]/div/a[1]"
                                                                    )))

        #Retrieve and append job url
        url = driver.current_url
        batch_unprocessed_query_results.loc[i] = [key, url]
        i = i + 1
    return batch_unprocessed_query_results

def unfiltered_querier(cloned_job,
                       dataset_name,
                       user,
                       passkey,
                       user_email,
                       identifier = ""
                       ):
    """
    Automatically queries various pre-defined MassQL head group queries

    :param str cloned_job: URL to Proteomics2 job with presets to be cloned
    :param str dataset_name: Name of dataset, used for labeling jobs
    :param str user: Your Proteomics2 username
    :param str passkey: Your Proteomics2 password
    :param str user_email: Your email
    :param str identifier: Optional identifier appended to identify each job
    :return: Dataframe with the links to queries of different head groups
    :rtype: pandas.DataFrame
    """

    result_columns = ["Head", "query_job"]
    batch_unprocessed_query_results = pd.DataFrame(columns=result_columns)

    #Clear old login information
    driver.get("https://proteomics2.ucsd.edu/ProteoSAFe/user/logout.jsp")

    #Visit original link
    driver.get(cloned_job)

    #Login to Proteomics2
    iframe_xpath = '/html/body/div/a/div/div[1]/iframe'
    driver.switch_to.frame(driver.find_element(By.XPATH, iframe_xpath))

    #Enter username
    username = WebDriverWait(driver, 5).until(EC.presence_of_element_located((By.NAME,
                                                                              'user'
                                                                              )))
    username.clear()
    username.send_keys(user)

    #Enter password
    password = WebDriverWait(driver, 5).until(EC.presence_of_element_located((By.NAME,
                                                                              'password'
                                                                              )))
    password.clear()
    password.send_keys(passkey)
    password.send_keys(Keys.ENTER)

    #Begin queries
    i = 0
    for key in queries_data.keys():
        #Revisit job
        driver.get(cloned_job)

        #Visit cloned job
        WebDriverWait(driver, 20).until(EC.element_to_be_clickable((By.LINK_TEXT,
                                                                    'Clone'
                                                                    ))).click()

        #Wait until entry fields have loaded in
        WebDriverWait(driver, 20).until(EC.presence_of_element_located((By.NAME,
                                                                        'desc'
                                                                        )))
        #Enter in job name
        job_name = dataset_name + " " + key + " " + identifier
        job_query = queries_data[key]
        name_field = driver.find_element(By.NAME, 'desc')
        name_field.clear()
        name_field.send_keys(job_name)

        #Enter in query information
        WebDriverWait(driver, 20).until(EC.presence_of_element_located((By.NAME,
                                                                        'QUERY'
                                                                        )))
        query_field = driver.find_element(By.NAME, 'QUERY')
        query_field.clear()
        query_field.send_keys(job_query)

        #Enter user email
        WebDriverWait(driver, 20).until(EC.presence_of_element_located((By.NAME,
                                                                        'email'
                                                                        )))
        email = driver.find_element(By.NAME, 'email')
        email.clear()
        email.send_keys(user_email)

        #Submit job
        submit = driver.find_element(By.ID, "submit_workflow")
        submit.click()

        #Move past any alerts
        try:
            WebDriverWait(driver, 5).until(EC.alert_is_present())
            alert = driver.switch_to.alert
            alert.accept()
        except:
            pass

        #Wait until job has been processed
        WebDriverWait(driver, 40).until(EC.element_to_be_clickable((By.LINK_TEXT,
                                                                    "RUNNING"
                                                                    )))
        try:
            WebDriverWait(driver, 5).until(EC.alert_is_present())
            alert = driver.switch_to.alert
            alert.accept()
        except:
            pass

        #Retrieve and append job url
        url = driver.current_url
        batch_unprocessed_query_results.loc[i] = [key, url]
        i = i + 1
    return batch_unprocessed_query_results
